  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  username = ""
}
<h1>Events with parameters</h1>

<h1>Hello {{ username }}</h1>

<br>

<label for="username">Insert your username: </label>
